import React, { useState, useEffect } from 'react';
import logo from '../images/zeptoLogo.svg';
import { useNavigate } from 'react-router-dom';

function Navbar() {
  const [showDropdown, setShowDropdown] = useState(false);
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [phoneNumber, setPhoneNumber] = useState('');
  const [generatedOtp, setGeneratedOtp] = useState(null);
  const [otp, setOtp] = useState('');
  const [otpError, setOtpError] = useState('');
  const [showOtpInput, setShowOtpInput] = useState(false);
  const [otpVerified, setOtpVerified] = useState(false);
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem('token');
    setIsLoggedIn(!!token);
  }, []);

  const handleIconClick = () => {
    setShowDropdown(!showDropdown);
  };

  const goToLogin = () => {
    navigate('/Login');
    setShowDropdown(false);
  };

  const goToRegister = () => {
    navigate('/Register');
    setShowDropdown(false);
  };

  const handleLogout = () => {
    localStorage.removeItem('token');
    setIsLoggedIn(false);
    setShowDropdown(false);
    alert('Logged out successfully!');
    navigate('/');
  };

  function redirectToHome() {
    navigate('/Home');
  }

  const generateOtp = () => {
    if (phoneNumber.length !== 10) {
      alert('Please enter a valid 10-digit phone number');
      return;
    }
    const newOtp = Math.floor(100000 + Math.random() * 900000);
    setGeneratedOtp(newOtp);
    console.log('Generated OTP:', newOtp);
    setShowOtpInput(true);
    setOtpError('');
  };

  const verifyOtp = () => {
    if (otp === String(generatedOtp)) {
      alert('OTP Verified Successfully!');
      setOtpVerified(true);
      setShowOtpInput(false);
      setOtp('');
      setGeneratedOtp(null);
    } else {
      setOtpError('Invalid OTP. Please try again.');
    }
  };

  const handleRegister = () => {
    if (!name || !email) {
      alert('Please fill in all fields.');
      return;
    }
    // Here you can call your backend API to register the user
    console.log('Registering User:', { name, email, phoneNumber });
    alert('User registered successfully!');
    setName('');
    setEmail('');
    setPhoneNumber('');
    setOtpVerified(false);
  };

  return (
    <div className='shadow-lg'>
      <div className='container-fluid shadow-lg p-4'>
        <div className='row align-items-center'>
          <div className='col-lg-2'>
            <img src={logo} alt='logo' width="120" onClick={redirectToHome} style={{ cursor: 'pointer' }} />
          </div>
          <div className='col-lg-2'>
            <p>Location</p>
          </div>
          <div className='col-lg-5'>
            <input className='form-control' placeholder='Search' type='text' />
          </div>
          <div className='col-lg-1 position-relative'>
            <i 
              className="fa fa-user-circle-o fa-2x" 
              aria-hidden="true" 
              style={{ cursor: 'pointer' }}
              onClick={handleIconClick}
            ></i>

            {/* Dropdown */}
            {showDropdown && (
              <div className="position-absolute bg-white shadow rounded p-2" style={{ top: '50px', right: '0' }}>
                {isLoggedIn ? (
                  <p style={{ cursor: 'pointer' }} onClick={handleLogout}>Logout</p>
                ) : (
                  <>
                    <p style={{ cursor: 'pointer' }} onClick={goToLogin}>Login</p>
                    <p style={{ cursor: 'pointer' }} onClick={goToRegister}>Register</p>
                  </>
                )}
              </div>
            )}
          </div>

          {/* Cart Section */}
          <div className='col-lg-1'>
            Cart
          </div>
        </div>

        {/* Phone Number Section */}
        <div className="row mt-4 justify-content-center">
          <div className="col-lg-4">
            <input 
              type="text"
              className="form-control mb-2"
              placeholder="Enter Phone Number"
              value={phoneNumber}
              onChange={(e) => setPhoneNumber(e.target.value)}
              maxLength="10"
            />
            <button className="btn btn-primary btn-sm" onClick={generateOtp}>
              Get OTP
            </button>
          </div>
        </div>

        {/* OTP Input Section */}
        {showOtpInput && (
          <div className="row mt-3 justify-content-center">
            <div className="col-lg-4">
              <input 
                type="text"
                className="form-control mb-2"
                placeholder="Enter OTP"
                value={otp}
                onChange={(e) => setOtp(e.target.value)}
                maxLength="6"
              />
              <button className="btn btn-success btn-sm" onClick={verifyOtp}>
                Verify OTP
              </button>
              {otpError && <p className="text-danger mt-2">{otpError}</p>}
            </div>
          </div>
        )}

        {/* After OTP Verified, show Name and Email */}
        {otpVerified && (
          <div className="row mt-4 justify-content-center">
            <div className="col-lg-4">
              <input 
                type="text"
                className="form-control mb-2"
                placeholder="Enter Name"
                value={name}
                onChange={(e) => setName(e.target.value)}
              />
              <input 
                type="email"
                className="form-control mb-2"
                placeholder="Enter Email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
              />
              <button className="btn btn-success btn-sm" onClick={handleRegister}>
                Register
              </button>
            </div>
          </div>
        )}
      </div>
    </div>
  )
}

export default Navbar;
